description_lv:
100% dabīgas augstākās kvalitātes krievu matu šķipsnas ar itāļu keratīna kapsulām.
Matu šķipsnas sver 0,7-0,8 gramu. Mati neuzbriest un nelocās.
Ražošanas procesā mati tiek apstrādāti termiski, ķīmiski, bioloģiski, lai likvidētu iespējamās baktērijas.
Ieteikums meistariem:
Izgrieziet keratīna kapsulu tikai pēc vajadzības. Pārmērīga matu izkrišana var izraisīt pieaudzēto matu izkrišanu;
Keratīna kapsulas laušana nav ieteicama;
Krāsojiet matus tikai pēc dažām mazgāšanas reizēm, lai tiktu nomazgāti aizsargslāņi;
Ieteikums klientiem:
Mazgājiet matus zem remdena ūdens, lai krāsa saglabātos ilgāk;
Katras mazgāšanas laikā izmantojiet dziļi mitrinošas maskas;
Izmantojiet pārbaudītus matu kopšanas līdzekļus, kas nesatur sulfātus, sāļus, parabēnus;
Pēc mazgāšanas lietot eļļas, serumus;
Mazāk apmeklēt baseinus – hlors negatīvi ietekmē matus;
Mazināt peldes jūrā  – sāls iespaidā mati izžūst;
Neapmeklējiet saunas;
Izžāvējiet matus, pirms ejat gulēt;
Nekarsējiet matus pie saknēm: matu žāvētājs, taisnotājs, ruļļi
Pareizi kopjot matus, tie var lieliski saglabāties līdz pat 24 mēnešiem.

description_en:
100% Natural Premium Russian Hair Bundles with Italian Keratin Capsules.
Hair strands weigh 0.7-0.8 grams. Hair does not swell or bend.
In the production process, the hair is treated thermally, chemically, biologically to eliminate possible bacteria.
Recommendation for masters:
Cut the keratin capsule only as needed. Excessive hair loss can cause hair extensions to fall out;
Breaking the keratin capsule is not recommended;
Dye your hair only after a few washes so that the protective layers are washed away;
Recommendation for customers:
Wash your hair under lukewarm water to make the color last longer;
Use deeply moisturizing masks during each wash;
Use proven hair care products that do not contain sulfates, salts, parabens;
After washing, use oils, serums;
Visit swimming pools less - chlorine has a negative effect on the hair;
Minimize swimming in the sea - hair dries out under the influence of salt;
Do not visit saunas;
Dry your hair before going to bed;
Do not heat the hair at the roots: hair dryer, straightener, rollers
With proper care, hair can last up to 24 months.

